import { EmptyState, Layout, Page } from '@shopify/polaris'



function index() {
  return(
    <div>
      <EmptyState>
        <Layout>
          <Page>
            <p>Hello oooo</p>
          </Page>
        </Layout>
      </EmptyState>

    </div>
  )
}

export default index;
